import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faPhone, faEnvelope } from "@fortawesome/free-solid-svg-icons";
import { useState } from "react";

function Contact() {
  const [isPhoneClicked, setIsPhoneClicked] = useState(false);
  const [isEmailClicked, setIsEmailClicked] = useState(false);

  return (
    <div className="bg-lightTone">
      <div className="max-w-screen-lg mx-auto flex flex-col items-center py-padY">
        <div className="font-racing text-5xl p-10 text-darkTone">
          Get in Touch
        </div>
        <div className="pb-10">
          <div className="flex flex-row px-10 pb-10 gap-4">
            <div className="border-4 border-darkTone rounded-xl">
              <FontAwesomeIcon
                className="text-darkTone p-8"
                icon={faPhone}
                size="2x"
              />
            </div>
            <div className="border-4 border-darkTone rounded-xl">
              <FontAwesomeIcon
                className="text-darkTone p-8"
                icon={faEnvelope}
                size="2x"
              />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Contact;
